import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div style={{ padding: '20px', textAlign: 'center', backgroundColor: 'lightblue' }}>
        <h1>IT Support System - Router Test</h1>
        
        {/* Simple navigation */}
        <div style={{ marginBottom: '20px' }}>
          <a href="/" style={{ marginRight: '10px' }}>Home</a>
          <a href="/about" style={{ marginRight: '10px' }}>About</a>
          <a href="/contact">Contact</a>
        </div>

        <Routes>
          <Route path="/" element={<div>üè† Home Page</div>} />
          <Route path="/about" element={<div>üìñ About Page</div>} />
          <Route path="/contact" element={<div>üìû Contact Page</div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
